import React from 'react'

const Login = () => {
    const handleSubmit =async(e) =>{
        e.preventDefault();
        fetch ()
        const response = await fetch("http://localhost:5000/api/auth/login", {
            method: 'GET',
            headers: {
              'content-type': 'application/json',
              'auth-token':"eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyIjp7ImlkIjoiNjRkMzIxNjBmOGNmNDBjZTVhMGRhZGFlIn0sImlhdCI6MTY5MTU1OTM1Nn0.cxVUSsgJoaKqQSfMJ3wCP2K7-Ad4DVbUJW0xrcRqc0M"

            }

        });
        const json = await response.json()
        console.log(json);
    }
  return (
    <div>
      <form>
  <div class="mb-3">
    <label for="email1" class="form-label">Email address</label>
    <input type="email" class="form-control" id="email" name="email" aria-describedby="emailHelp"/>
    <div id="emailHelp" class="form-text">We'll never share your email with anyone else.</div>
  </div>
  <div class="mb-3">
    <label for="password" class="form-label">Password</label>
    <input type="password" class="form-control" name="password" id="password"/>
  </div>
  <button type="submit" class="btn btn-primary" onSubit ={handleSubmit}>Submit</button>
</form>
    </div>
  )
}

export default Login
